import Sidebar from "../../core/components/core-sidebar";
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import { ReactComponent as FUBULogoSmall } from '../../assets/fubu_logo_small.svg'
import Grid from '@material-ui/core/Grid';
import theme from '../../theme';
import { Typography } from '@material-ui/core';
import Button from '@material-ui/core/Button';
import Emoji from '../../core/components/core-emoji';


const useStyles = makeStyles((theme) => ({
    root: {

    },
    logo: {
        paddingTop: theme.spacing(14),
        paddingBottom: theme.spacing(6),
        textAlign: 'center',
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'block',
    },
    bigButtons: {
        width: '420px',
        height: '77px',
        fontWeight: 400,
        marginTop: '15px',
        marginBottom: '25px',
        fontSize: '33px',
        borderRadius: '8px',
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'block',
        borderColor: '#FFB9AE',
        '&:hover': {
            backgroundColor: '#FFB9AE',
        },
    },
    miniButtons: {
        width: '143px',
        height: '46px',
        marginTop: '60px',
        marginBottom: '25px',
        marginLeft: '25px',
        marginRight: '25px',
        fontSize: '24px',
        borderRadius: '8px',
    },
    logout: {
        backgroundColor: theme.palette.error.main,
        width: '148px',
        height: '46px',
        color: "#fff",
        fontSize: '24px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.25)',
        '&:hover': {
            backgroundColor: theme.palette.error.dark,
        },
    },
    text: {
        marginTop: '10px',
        marginBottom: '50px',
        textAlign: 'center',
    }
}));



function DashOrg() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container className={classes.root} >
                <Grid item xs={2}>
                    <Sidebar></Sidebar>
                </Grid>
                <Grid item xs={9}></Grid>
                <Grid container >
                    <Grid item xs={6}>
                        <Grid className={classes.text} item xs={12}>
                            <Typography variant="h1"> Good afternoon, (user first name here)!</Typography>
                        </Grid>
                        <Grid className={classes.text} item xs={12}>
                            <Button className={classes.miniButtons} variant="contained" color="secondary">Back</Button>
                            <Button className={classes.miniButtons} variant="contained" disabled={"disabled"} color="primary">Next</Button>
                        </Grid>
                        <Button className={classes.logout} variant="contained" size="large" color="error">Logout</Button>

                    </Grid>
                </Grid>
            </Grid>
        </ThemeProvider >

    );
}

export default DashOrg;
